  selector: 'app-root',
  standalone: true,
  imports: [RouterOutlet, NavbarComponent],
  template: `
    <div class="container-fluid">
      <app-navbar></app-navbar>
      <main class="container mt-4">
        <router-outlet></router-outlet>
      </main>
    </div>
  `,
  styles: []
})
export class AppComponent {
  title = '3813ICT Chat App';
}
